import React, { Component, Fragment } from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Login from "./login";
import BaseLayout from "./layout";
import {CommonLayout} from "./layout";
import { Form } from "antd";
import "antd/dist/antd.css";
import PrivateRoute from "./PrivateRoute";
// import { loadUser } from "../actions/accounts/auth";
// import {store} from "../index";

class App extends Component {
  render() {
    const LoginFrom = Form.create({ name: "Login" })(Login);
    return (
      <div>
        <BrowserRouter>
          <Fragment>
            <PrivateRoute exact path="/" component={BaseLayout} />
            <PrivateRoute exact path="/adduser" component={BaseLayout} />
            <PrivateRoute  path="/profile" component={BaseLayout} />
            <PrivateRoute  path="/users" component={BaseLayout} />
            <PrivateRoute  path="/calendar" component={BaseLayout} />
            <Route path="/login" component={LoginFrom} />
            <Route path="/appointment/book" component={CommonLayout} />
            <Route path="/appointment/info" component={CommonLayout} />
          </Fragment>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
